import { createRouter, createWebHistory } from 'vue-router'

import HomePage from '@/components/pages/HomePage.vue.vue';
import AccountPage from '@/components/pages/AccountPage.vue.vue';
import CategoryPage from '@/components/pages/CategoryPage.vue.vue';
import NotFoundPage from '@/components/pages/NotFoundPage.vue.vue';
import LoginPage from '@/components/pages/LoginPage.vue.vue';
import TransferIndex from '@/components/pages/transfers/TransferIndex.vue.vue';
import TransferCreate from '@/components/pages/transfers/TransferCreate.vue.vue';
import PeriodPage from '@/components/pages/PeriodPage.vue';

const routes = [
    {
        path: '/',
        component: HomePage
    },
    {
        path: '/accounts',
        component: AccountPage
    },
    {
        path: '/transfers',
        component: TransferIndex
    },
    {
        path: '/transfers/create',
        component: TransferCreate
    },
    {
        path: '/transfer/create-by-category/:category_id',
        component: TransferCreate
    },
    {
        path: '/login',
        component: LoginPage
    },
    {
        path: '/:pathMach(.*)*',
        component: NotFoundPage
    },

    // v2
    {
        path: '/categories',
        component: CategoryPage
    },
    {
        path: '/periods',
        component: PeriodPage
    },
]

const router = createRouter({
    history:createWebHistory(),
    routes,
})

export default router
